import { getAPI } from "../helpers/helpers";

export default async function fetchProductSearch(
    searchQuery: string = "",
    perPage: number
): Promise<Response> {
    console.log(searchQuery.split(' ').join('+'))
  return getAPI(`/products?items_per_page=${perPage}?filter_title=${searchQuery.split(' ').join('+')}`)
}
